import React from 'react';

import { Container, Row, Col } from 'react-bootstrap';

export default props => {
    return(
        <div>
            <Container>
                <Row>
                    <Col xs={6} md={4}>
                        xs=6 md=4
                    </Col>
                    <Col xs={12} md={8}>
                        xs=12 md=8
                    </Col>
                </Row>
                </Container>
            <h1>My name is Lichelle Gaerlan</h1>
            <h3>I'm a recent university graduate.</h3>
        </div>
    );
}
